Create Mongoose Find and populate from multiple tables with property set<p>I'll be grateful for help with Mongoose. I have 3 tables: (Users)Table of users, (Animals)table of animals and table AnimalComments. So (AnimalComments)table reference users and animals.</p>

<pre><code>const schemaComment = new mongoose.Schema({
        userRef: {
            type: mongoose.Schema.Types.ObjectId,
            ref: 'User'
        },
        animalRef: {
            type: mongoose.Schema.Types.ObjectId,
            ref: 'Animal'
        },
        content: {
            type: String
        }
    });

const schemaAnimal = new mongoose.Schema({
    name: {
        type: String
    },
    isCommentedByMe: {
        type   : Boolean,
        default: false
    },
    commentCount: {
        type   : Number,
        default: 0
    }
});
</code></pre>

<p>What I want: I have animals. Users can add comment to animal. When user comment animal his comment is added to table AnimalComments where is stored userRef (userId), animalRef (animalId) and user comment text. Then in request response I want return all animals from table Animals but I need update property commentCount and isCommentedByMe based on value from table AnimalComments. </p>

<p><strong>Response from table Animals:</strong></p>

<pre><code>{
    "animals": [
        {
            "isCommentedByMe": false,
            "commentCount": 0,
            "name": "Jessica",
            "userRef": {
                "id": "5dc9bdf3dd5cae00177e184d"
            },
            "id": "5dcedd48368e9800176f2ef3"
        }
    ]
}
</code></pre>

<p><strong>Response from table Users:</strong></p>

<pre><code>{
    "users": [
        {
            "name": "Jony Cash",
            "id": "5dc9bdf3dd5cae00177e184d"
        }
    ]
}
</code></pre>

<p><strong>Response from table AnimalComments:</strong></p>

<pre><code>{
    "comments": [
        {
            "userRef": "5dc9bdf3dd5cae00177e184d",
            "animalRef": "5dcedd48368e9800176f2ef3",
             "content": "Sample text"
        }
    ]
}
</code></pre>

<p><strong>I want result for exmaple:</strong></p>

<pre><code>{
    "animals": [
        {
            "isCommentedByMe": true, 
            "commentCount": 4, 
            "name": "Jessica",
            "userRef": {
                "id": "5dc9bdf3dd5cae00177e184d"
            },
            "id": "5dcedd48368e9800176f2ef3"
        }
    ]
}
</code></pre>

