.NET port forwarding issue<p>I try to create ssh tunel in my application and access remote mongo from CLI.  </p>

<p><em>The ssh server on remote host listening on port 9901<br>
Remote Mongo port: 27017<br>
Local host have: Windows 10, VS 2019<br>
Assembly Renci.SshNet, Version=2016.1.0.0<br>
Remote host is Debian 9.9</em>  </p>

<p>I success to access if I do port forwarding from Cygwin, but failing if I do it from C#.  </p>

<p><strong>Scenario 1</strong></p>

<p>Open port forwarding:  </p>

<pre><code>ssh -p 9901 -L 50001:localhost:27017 user@host.net
</code></pre>

<p>Connect Mongo from localhost:</p>

<pre><code>c:\Program Files\MongoDB\Server\3.6\bin&gt;mongo --port 50001 --host localhost
MongoDB shell version v3.6.13
connecting to: mongodb://localhost:50001/?gssapiServiceName=mongodb
WARNING: No implicit session: Logical Sessions are only supported on server versions 3.6 and greater.
Implicit session: dummy session
MongoDB server version: 3.2.11
WARNING: shell and server versions do not match
&gt;
</code></pre>

<p><strong>Scenario 2</strong></p>

<p>Code for port forwarding:</p>

<pre><code>namespace VT_lic
{
    public static class PortForwarding
    {        
        static SshClient client;
        static ForwardedPortLocal portFwld;

        public static void Connect ()
        {
            PasswordConnectionInfo conn = new PasswordConnectionInfo(
                "host.net",
                9901,
                "user",
                "password"
            );

            client = new SshClient(conn);
            portFwld = new ForwardedPortLocal("localhost", 50001, "host.net", 27017);

            try
            {
                Console.WriteLine("Trying SSH connection...");
                client.Connect();
                Console.WriteLine(client.CreateCommand("ls").Execute());

                if (!client.IsConnected)
                    throw new Exception("Kosha ssh connection failed");       

                client.AddForwardedPort(portFwld);
                portFwld.Start();

                if (!portFwld.IsStarted)
                    throw new Exception("Kosha port forward failed");

            }
            catch (System.Net.Sockets.SocketException ex1)
            {
                throw new Exception("Kosha port forward failed");
            }
        }
    }
}
</code></pre>

<p>Console output:</p>

<blockquote>
  <p>backup<br>
  mk.sh<br>
  temp<br>
  file1<br>
  file2</p>
</blockquote>

<p>Connection to Mongo:  </p>

<pre><code>c:\Program Files\MongoDB\Server\3.6\bin&gt;mongo --port 50001 --host localhost
MongoDB shell version v3.6.13
connecting to: mongodb://localhost:50001/?gssapiServiceName=mongodb
</code></pre>

<p>Netstat:  </p>

<pre><code>C:\WINDOWS\system32&gt;netstat -a -n | find "50001"
  TCP    127.0.0.1:58045        127.0.0.1:50001        SYN_SENT
  TCP    [::1]:50001            [::]:0                 LISTENING
</code></pre>

<p>I tried all options:</p>

<pre><code>new ForwardedPortLocal("localhost", 50001, "host.net", 27017);
new ForwardedPortLocal("localhost", 50001, "localhost", 27017);
new ForwardedPortLocal(50001, "localhost", 27017);
new ForwardedPortLocal(27017, "localhost", 50001);
new ForwardedPortDynamic("localhost", 27017); // --port 27017 in CLI also
</code></pre>

