How to calculate average in mongoose?<p>My schema looks like </p>

<pre class="lang-js prettyprint-override"><code>point: { type: Number, default: 0 },
effort: { type: Number, default: 0 },
note: { type: String },
dateRated: {type: Date},
createDate: {type:Date},
dateInfoId: {type: String}
</code></pre>

<p>I'm trying to calculate average of point and effort by passing certain <code>_id</code>'s</p>

<p>My code looks like </p>

<pre class="lang-js prettyprint-override"><code>frequencies = ["mongo object id"];
Frequency.aggregate([{
    $project: {
        _id: {
            $in: ['$_id', frequencies]
        },
        point: {
            $ne: ['$point', 0]
        }
    }
}, {
    $group: {
        _id: {
            $in: ['$_id', frequencies]
        },
        average: {
            $avg: "$point"
        },
        effort: {
            $avg: "$effort"
        }
    }
}], (err, result) =&gt; {});
</code></pre>

<p>But it always returns <code>[ { _id: false, average: null, effort: null } ]</code>. What should I do to calculate the average of my points and effort?</p>

